import styled from 'styled-components/native';


export const CardContainer = styled.View`
    borderWidth: 2px;
    borderColor:${props => props.theme.PRIMARY_COLOR};
    backgroundColor: ${props => props.theme.BG_COMPLIMENT};
    width: 100%;
    padding: 20px;
    borderRadius: 10px;
    marginBottom: 30px;
    flexDirection: row;
    alignItems: center;
    justifyContent: space-between;
`;

export const InfoSection = styled.View`
    flexDirection: column;
`;

export const AllUsersList = styled.View`
    width: 100%;
    padding: 20px;
`;

export const ProfileImage = styled.Image`
  height: 85px;
  width: 85px;
  borderRadius: 100px;
`;
